export default function SecimTakipSistemi() {
  const [girisYapildi, setGirisYapildi] = useState(false);
  const [kullaniciRolu, setKullaniciRolu] = useState('');
  const [kullaniciAdi, setKullaniciAdi] = useState('');
  
  const [girisTipi, setGirisTipi] = useState('referans');
  const [seciliKullanici, setSeciliKullanici] = useState('');
  const [sifre, setSifre] = useState('');
  const [girisHatasi, setGirisHatasi] = useState('');
  
  const [aramaText, setAramaText] = useState('');
  const [filtre, setFiltre] = useState('hepsi');
  const [geldiDurumu, setGeldiDurumu] = useState({});
  const [showResetConfirm, setShowResetConfirm] = useState(false);
  const [loading, setLoading] = useState(true);
  const [seciliGoruntuRol, setSeciliGoruntuRol] = useState('');

  useEffect(() => {
    const saved = localStorage.getItem('secim-geldi-2026-v3');
    if (saved) setGeldiDurumu(JSON.parse(saved));
    
    const oturum = localStorage.getItem('secim-oturum-2026-v2');
    if (oturum) {
      const o = JSON.parse(oturum);
      setKullaniciRolu(o.rol);
      setKullaniciAdi(o.ad);
      setGirisYapildi(true);
    }
    setLoading(false);
  }, []);

  useEffect(() => {
    if (!loading) localStorage.setItem('secim-geldi-2026-v3', JSON.stringify(geldiDurumu));
  }, [geldiDurumu, loading]);

  const girisYap = () => {
    setGirisHatasi('');
    
    if (girisTipi === 'admin') {
      const admin = KULLANICILAR.adminler.find(a => a.ad === seciliKullanici);
      if (!seciliKullanici) { setGirisHatasi('Lütfen adınızı seçin!'); return; }
      if (!admin || sifre !== admin.sifre) { setGirisHatasi('Yanlış şifre!'); return; }
      const oturum = { rol: 'admin', ad: admin.ad };
      localStorage.setItem('secim-oturum-2026-v2', JSON.stringify(oturum));
      setKullaniciRolu('admin');
      setKullaniciAdi(admin.ad);
      setGirisYapildi(true);
    } else if (girisTipi === 'moderator') {
      const mod = KULLANICILAR.moderatorler.find(m => m.ad === seciliKullanici);
      if (!seciliKullanici) { setGirisHatasi('Lütfen adınızı seçin!'); return; }
      if (!mod || sifre !== mod.sifre) { setGirisHatasi('Yanlış şifre!'); return; }
      const oturum = { rol: 'moderator', ad: mod.ad };
      localStorage.setItem('secim-oturum-2026-v2', JSON.stringify(oturum));
      setKullaniciRolu('moderator');
      setKullaniciAdi(mod.ad);
      setGirisYapildi(true);
    } else {
      if (!seciliKullanici) { setGirisHatasi('Lütfen adınızı seçin!'); return; }
      const oturum = { rol: 'referans', ad: seciliKullanici };
      localStorage.setItem('secim-oturum-2026-v2', JSON.stringify(oturum));
      setKullaniciRolu('referans');
      setKullaniciAdi(seciliKullanici);
      setGirisYapildi(true);
    }
  };

  const cikisYap = () => {
    localStorage.removeItem('secim-oturum-2026-v2');
    setGirisYapildi(false);
    setKullaniciRolu('');
    setKullaniciAdi('');
    setSifre('');
    setSeciliKullanici('');
    setSeciliGoruntuRol('');
    setGirisTipi('referans');
  };

  const toggleGeldi = (kisiId) => {
    setGeldiDurumu(prev => ({ ...prev, [kisiId]: !prev[kisiId] }));
  };

  const resetAll = () => {
    setGeldiDurumu({});
    localStorage.removeItem('secim-geldi-2026-v3');
  };

  const filtrelenmisKisiler = useMemo(() => {
    let kisiler = [];
    
    if (kullaniciRolu === 'admin' || kullaniciRolu === 'moderator') {
      if (seciliGoruntuRol) {
        kisiler = SECIM_DATA.kisiler.filter(k => k.referanslar.includes(seciliGoruntuRol));
      } else {
        kisiler = SECIM_DATA.kisiler.filter(k => k.referanslar.length > 0);
      }
    } else {
      kisiler = SECIM_DATA.kisiler.filter(k => k.referanslar.includes(kullaniciAdi));
    }

    if (aramaText) {
      const s = aramaText.toLowerCase();
      kisiler = kisiler.filter(k => k.ad.toLowerCase().includes(s) || k.sicil.includes(aramaText) || k.telefon.includes(aramaText));
    }

    if (filtre === 'geldi') kisiler = kisiler.filter(k => geldiDurumu[k.id]);
    else if (filtre === 'gelmedi') kisiler = kisiler.filter(k => !geldiDurumu[k.id]);

    return kisiler;
  }, [kullaniciRolu, kullaniciAdi, seciliGoruntuRol, aramaText, filtre, geldiDurumu]);

  const istatistikler = useMemo(() => {
    let tumKisiler = [];
    if (kullaniciRolu === 'admin' || kullaniciRolu === 'moderator') {
      if (seciliGoruntuRol) tumKisiler = SECIM_DATA.kisiler.filter(k => k.referanslar.includes(seciliGoruntuRol));
      else tumKisiler = SECIM_DATA.kisiler.filter(k => k.referanslar.length > 0);
    } else {
      tumKisiler = SECIM_DATA.kisiler.filter(k => k.referanslar.includes(kullaniciAdi));
    }
    const gelen = tumKisiler.filter(k => geldiDurumu[k.id]).length;
    return { toplam: tumKisiler.length, gelen, gelmeyen: tumKisiler.length - gelen };
  }, [kullaniciRolu, kullaniciAdi, seciliGoruntuRol, geldiDurumu]);

  const genelIstatistik = useMemo(() => {
    if (kullaniciRolu !== 'admin' && kullaniciRolu !== 'moderator') return null;
    const tumReferanslilar = SECIM_DATA.kisiler.filter(k => k.referanslar.length > 0);
    const gelen = tumReferanslilar.filter(k => geldiDurumu[k.id]).length;
    return { toplam: tumReferanslilar.length, gelen, gelmeyen: tumReferanslilar.length - gelen };
  }, [kullaniciRolu, geldiDurumu]);

  if (loading) {
    return (
      <div style={{minHeight:'100vh',background:'linear-gradient(135deg,#1a1a2e 0%,#16213e 50%,#0f3460 100%)',display:'flex',alignItems:'center',justifyContent:'center'}}>
        <div style={{color:'#fff',fontSize:'1.5rem'}}>Yükleniyor...</div>
      </div>
    );
  }

  // GİRİŞ EKRANI
  if (!girisYapildi) {
    return (
      <div style={{minHeight:'100vh',background:'linear-gradient(135deg,#1a1a2e 0%,#16213e 50%,#0f3460 100%)',fontFamily:'system-ui,-apple-system,sans-serif',display:'flex',alignItems:'center',justifyContent:'center',padding:'20px'}}>
        <style>{`
          *{box-sizing:border-box}
          .card{background:rgba(255,255,255,0.03);border:1px solid rgba(255,255,255,0.08);border-radius:20px}
          .btn{background:linear-gradient(135deg,#e94560,#ff6b6b);border:none;color:#fff;padding:14px 28px;border-radius:12px;font-weight:600;cursor:pointer;font-size:1rem;width:100%}
          .btn:active{transform:scale(0.98)}
          select,input{background:rgba(255,255,255,0.05);border:1px solid rgba(255,255,255,0.1);color:#fff;padding:14px;border-radius:10px;font-size:1rem;width:100%;outline:none}
          select option{background:#1a1a2e}
          .tab{background:rgba(255,255,255,0.05);border:1px solid rgba(255,255,255,0.1);color:rgba(255,255,255,0.6);padding:10px 16px;border-radius:8px;cursor:pointer;font-size:0.9rem;flex:1;text-align:center}
          .tab.active{background:linear-gradient(135deg,#e94560,#ff6b6b);border-color:#e94560;color:#fff}
        `}</style>
        
        <div className="card" style={{padding:'30px',maxWidth:'400px',width:'100%'}}>
          <div style={{textAlign:'center',marginBottom:'24px'}}>
            <div style={{fontSize:'3rem',marginBottom:'10px'}}>🗳️</div>
            <h1 style={{color:'#fff',margin:'0 0 6px',fontSize:'1.5rem'}}>Seçim Takip</h1>
            <p style={{color:'rgba(255,255,255,0.5)',margin:0,fontSize:'0.9rem'}}>Giriş yapın</p>
          </div>
          
          <div style={{display:'flex',gap:'8px',marginBottom:'20px'}}>
            <button className={`tab ${girisTipi==='referans'?'active':''}`} onClick={()=>{setGirisTipi('referans');setGirisHatasi('');setSeciliKullanici('');setSifre('')}}>
              👤 Referans
            </button>
            <button className={`tab ${girisTipi==='moderator'?'active':''}`} onClick={()=>{setGirisTipi('moderator');setGirisHatasi('');setSeciliKullanici('');setSifre('')}}>
              🛡️ Moderatör
            </button>
            <button className={`tab ${girisTipi==='admin'?'active':''}`} onClick={()=>{setGirisTipi('admin');setGirisHatasi('');setSeciliKullanici('');setSifre('')}}>
              ⚙️ Admin
            </button>
          </div>
          
          {girisTipi === 'referans' && (
            <div>
              <label style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem',marginBottom:'6px',display:'block'}}>Adınızı seçin:</label>
              <select value={seciliKullanici} onChange={e=>setSeciliKullanici(e.target.value)} style={{marginBottom:'16px'}}>
                <option value="">-- Listeden seçin --</option>
                {KULLANICILAR.referansSorumlulari.map(ad=>(<option key={ad} value={ad}>{ad}</option>))}
              </select>
            </div>
          )}
          
          {girisTipi === 'admin' && (
            <div>
              <label style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem',marginBottom:'6px',display:'block'}}>Adınızı seçin:</label>
              <select value={seciliKullanici} onChange={e=>setSeciliKullanici(e.target.value)} style={{marginBottom:'12px'}}>
                <option value="">-- Admin seçin --</option>
                {KULLANICILAR.adminler.map(a=>(<option key={a.ad} value={a.ad}>{a.ad}</option>))}
              </select>
              <label style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem',marginBottom:'6px',display:'block'}}>Şifre:</label>
              <input type="password" placeholder="Şifrenizi girin" value={sifre} onChange={e=>setSifre(e.target.value)} onKeyDown={e=>e.key==='Enter'&&girisYap()} style={{marginBottom:'16px'}}/>
            </div>
          )}
          
          {girisTipi === 'moderator' && (
            <div>
              <label style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem',marginBottom:'6px',display:'block'}}>Adınızı seçin:</label>
              <select value={seciliKullanici} onChange={e=>setSeciliKullanici(e.target.value)} style={{marginBottom:'12px'}}>
                <option value="">-- Moderatör seçin --</option>
                {KULLANICILAR.moderatorler.map(m=>(<option key={m.ad} value={m.ad}>{m.ad}</option>))}
              </select>
              <label style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem',marginBottom:'6px',display:'block'}}>Şifre:</label>
              <input type="password" placeholder="Şifrenizi girin" value={sifre} onChange={e=>setSifre(e.target.value)} onKeyDown={e=>e.key==='Enter'&&girisYap()} style={{marginBottom:'16px'}}/>
            </div>
          )}
          
          {girisHatasi && (
            <div style={{background:'rgba(233,69,96,0.2)',border:'1px solid rgba(233,69,96,0.4)',borderRadius:'8px',padding:'10px',marginBottom:'16px',color:'#ff6b6b',fontSize:'0.9rem',textAlign:'center'}}>
              {girisHatasi}
            </div>
          )}
          
          <button className="btn" onClick={girisYap}>Giriş Yap</button>
        </div>
      </div>
    );
  }

  // ANA UYGULAMA
  return (
    <div style={{minHeight:'100vh',background:'linear-gradient(135deg,#1a1a2e 0%,#16213e 50%,#0f3460 100%)',fontFamily:'system-ui,-apple-system,sans-serif'}}>
      <style>{`
        *{box-sizing:border-box}
        .card{background:rgba(255,255,255,0.03);border:1px solid rgba(255,255,255,0.08);border-radius:16px}
        .btn{background:linear-gradient(135deg,#e94560,#ff6b6b);border:none;color:#fff;padding:10px 20px;border-radius:10px;font-weight:600;cursor:pointer}
        .btn:active{transform:scale(0.98)}
        .btn-call{background:linear-gradient(135deg,#00d9ff,#00b4d8);color:#1a1a2e;padding:8px 14px;border-radius:8px;font-weight:600;text-decoration:none;display:inline-block;border:none}
        .btn-call.disabled{background:#444;color:#888}
        .check{width:40px;height:40px;min-width:40px;border-radius:10px;border:2px solid rgba(255,255,255,0.2);display:flex;align-items:center;justify-content:center;cursor:pointer}
        .check.on{background:linear-gradient(135deg,#00c853,#00e676);border-color:#00c853}
        .stat{background:rgba(255,255,255,0.05);border-radius:12px;padding:14px;text-align:center;border:1px solid rgba(255,255,255,0.08)}
        .stat b{font-size:1.8rem;font-family:monospace}
        .row{background:rgba(233,69,96,0.08);border:1px solid rgba(233,69,96,0.2);border-radius:12px;padding:12px 14px;margin-bottom:8px;display:flex;align-items:center;gap:12px}
        .row.on{background:rgba(0,200,83,0.1);border-color:rgba(0,200,83,0.3)}
        select,input{background:rgba(255,255,255,0.05);border:1px solid rgba(255,255,255,0.1);color:#fff;padding:14px;border-radius:10px;font-size:1rem;width:100%;outline:none}
        select option{background:#1a1a2e}
        .fbtn{background:rgba(255,255,255,0.05);border:1px solid rgba(255,255,255,0.1);color:rgba(255,255,255,0.7);padding:8px 14px;border-radius:8px;cursor:pointer;font-size:0.85rem}
        .fbtn.on{background:linear-gradient(135deg,#e94560,#ff6b6b);border-color:#e94560;color:#fff}
        .bar{height:10px;background:rgba(255,255,255,0.1);border-radius:5px;overflow:hidden}
        .bar div{height:100%;background:linear-gradient(90deg,#00c853,#00e676);border-radius:5px;transition:width 0.3s}
        .modal{position:fixed;inset:0;background:rgba(0,0,0,0.8);display:flex;align-items:center;justify-content:center;z-index:1000;padding:20px}
        .modal>div{background:#1a1a2e;border:1px solid rgba(255,255,255,0.1);border-radius:16px;padding:24px;max-width:360px;text-align:center;width:100%}
        .badge{display:inline-block;padding:4px 10px;border-radius:6px;font-size:0.75rem;font-weight:600}
      `}</style>

      <div style={{background:'rgba(0,0,0,0.3)',borderBottom:'1px solid rgba(255,255,255,0.08)',padding:'14px 16px',position:'sticky',top:0,zIndex:100,backdropFilter:'blur(20px)'}}>
        <div style={{maxWidth:'700px',margin:'0 auto',display:'flex',alignItems:'center',justifyContent:'space-between',gap:'10px'}}>
          <div style={{display:'flex',alignItems:'center',gap:'10px'}}>
            <span style={{fontSize:'1.5rem'}}>🗳️</span>
            <div>
              <div style={{color:'#fff',fontWeight:700,fontSize:'1.1rem'}}>{kullaniciAdi}</div>
              <span className="badge" style={{
                background: kullaniciRolu==='admin'?'rgba(255,193,7,0.2)':kullaniciRolu==='moderator'?'rgba(0,217,255,0.2)':'rgba(0,200,83,0.2)',
                color: kullaniciRolu==='admin'?'#ffc107':kullaniciRolu==='moderator'?'#00d9ff':'#00c853'
              }}>
                {kullaniciRolu==='admin'?'⚙️ Admin':kullaniciRolu==='moderator'?'🛡️ Moderatör':'👤 Referans'}
              </span>
            </div>
          </div>
          <button onClick={cikisYap} style={{background:'rgba(255,255,255,0.1)',border:'1px solid rgba(255,255,255,0.2)',color:'#fff',padding:'8px 14px',borderRadius:'8px',cursor:'pointer',fontSize:'0.85rem'}}>Çıkış</button>
        </div>
      </div>

      <div style={{maxWidth:'700px',margin:'0 auto',padding:'14px'}}>
        
        {genelIstatistik && (
          <div className="card" style={{padding:'16px',marginBottom:'14px',background:'rgba(255,193,7,0.05)',borderColor:'rgba(255,193,7,0.2)'}}>
            <div style={{color:'#ffc107',fontWeight:600,marginBottom:'10px',fontSize:'0.9rem'}}>📊 Genel Durum</div>
            <div style={{display:'flex',justifyContent:'space-around',textAlign:'center'}}>
              <div><div style={{color:'#00d9ff',fontSize:'1.5rem',fontWeight:700,fontFamily:'monospace'}}>{genelIstatistik.toplam}</div><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.75rem'}}>Toplam</div></div>
              <div><div style={{color:'#00c853',fontSize:'1.5rem',fontWeight:700,fontFamily:'monospace'}}>{genelIstatistik.gelen}</div><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.75rem'}}>Geldi</div></div>
              <div><div style={{color:'#e94560',fontSize:'1.5rem',fontWeight:700,fontFamily:'monospace'}}>{genelIstatistik.gelmeyen}</div><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.75rem'}}>Beklenen</div></div>
              <div><div style={{color:'#ffc107',fontSize:'1.5rem',fontWeight:700,fontFamily:'monospace'}}>%{genelIstatistik.toplam?Math.round(genelIstatistik.gelen/genelIstatistik.toplam*100):0}</div><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.75rem'}}>Oran</div></div>
            </div>
          </div>
        )}

        {(kullaniciRolu==='admin'||kullaniciRolu==='moderator') && (
          <div className="card" style={{padding:'16px',marginBottom:'14px'}}>
            <label style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem',marginBottom:'6px',display:'block'}}>📋 Referans Sorumlusu Filtrele</label>
            <select value={seciliGoruntuRol} onChange={e=>setSeciliGoruntuRol(e.target.value)}>
              <option value="">-- Tüm Referanslar --</option>
              {SECIM_DATA.roller.map(r=>(<option key={r.ad} value={r.ad}>{r.ad} ({r.referans_sayisi} kişi)</option>))}
            </select>
          </div>
        )}

        <div style={{display:'grid',gridTemplateColumns:'repeat(4,1fr)',gap:'8px',marginBottom:'14px'}}>
          <div className="stat"><b style={{color:'#00d9ff'}}>{istatistikler.toplam}</b><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.7rem'}}>Toplam</div></div>
          <div className="stat"><b style={{color:'#00c853'}}>{istatistikler.gelen}</b><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.7rem'}}>Geldi</div></div>
          <div className="stat"><b style={{color:'#e94560'}}>{istatistikler.gelmeyen}</b><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.7rem'}}>Beklenen</div></div>
          <div className="stat"><b style={{color:'#ffd700'}}>%{istatistikler.toplam?Math.round(istatistikler.gelen/istatistikler.toplam*100):0}</b><div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.7rem'}}>Oran</div></div>
        </div>

        <div className="card" style={{padding:'14px',marginBottom:'14px'}}>
          <div style={{display:'flex',justifyContent:'space-between',marginBottom:'6px'}}>
            <span style={{color:'rgba(255,255,255,0.6)',fontSize:'0.85rem'}}>Katılım Oranı</span>
            <span style={{color:'#00c853',fontWeight:600,fontSize:'0.85rem'}}>{istatistikler.gelen}/{istatistikler.toplam}</span>
          </div>
          <div className="bar"><div style={{width:`${istatistikler.toplam?(istatistikler.gelen/istatistikler.toplam*100):0}%`}}/></div>
        </div>

        <div className="card" style={{padding:'14px',marginBottom:'14px'}}>
          <input type="text" placeholder="🔍 İsim, sicil veya telefon ara..." value={aramaText} onChange={e=>setAramaText(e.target.value)} style={{marginBottom:'10px'}}/>
          <div style={{display:'flex',gap:'6px',flexWrap:'wrap'}}>
            <button className={`fbtn ${filtre==='hepsi'?'on':''}`} onClick={()=>setFiltre('hepsi')}>Hepsi</button>
            <button className={`fbtn ${filtre==='gelmedi'?'on':''}`} onClick={()=>setFiltre('gelmedi')}>🔴 Aranacak ({istatistikler.gelmeyen})</button>
            <button className={`fbtn ${filtre==='geldi'?'on':''}`} onClick={()=>setFiltre('geldi')}>🟢 Geldi ({istatistikler.gelen})</button>
          </div>
        </div>

        <div className="card" style={{padding:'14px'}}>
          <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:'14px'}}>
            <span style={{color:'#fff',fontWeight:600}}>📋 {filtrelenmisKisiler.length} kişi</span>
            {kullaniciRolu==='admin' && (<button className="btn" style={{padding:'6px 12px',fontSize:'0.8rem'}} onClick={()=>setShowResetConfirm(true)}>🔄 Sıfırla</button>)}
          </div>

          {filtrelenmisKisiler.length===0?(
            <div style={{textAlign:'center',padding:'30px',color:'rgba(255,255,255,0.5)'}}>{aramaText?'Sonuç bulunamadı':'Liste boş'}</div>
          ):(
            filtrelenmisKisiler.map(k=>(
              <div key={k.id} className={`row ${geldiDurumu[k.id]?'on':''}`}>
                <div className={`check ${geldiDurumu[k.id]?'on':''}`} onClick={()=>toggleGeldi(k.id)}>
                  {geldiDurumu[k.id]&&<svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="#fff" strokeWidth="3"><polyline points="20 6 9 17 4 12"/></svg>}
                </div>
                <div style={{flex:1,minWidth:0}}>
                  <div style={{color:'#fff',fontWeight:600,marginBottom:'2px'}}>{k.ad}</div>
                  <div style={{color:'rgba(255,255,255,0.5)',fontSize:'0.8rem'}}>
                    #{k.sicil} • {k.telefon!=='Telefon Yok'?k.telefon:'📵 Tel yok'}
                    {(kullaniciRolu==='admin'||kullaniciRolu==='moderator') && k.referanslar.length>0 && (<span style={{color:'rgba(255,255,255,0.3)'}}> • {k.referanslar[0]}</span>)}
                  </div>
                </div>
                {!geldiDurumu[k.id] && k.telefon!=='Telefon Yok'?(<a href={`tel:${k.telefon}`} className="btn-call">📞 Ara</a>):!geldiDurumu[k.id]?(<span className="btn-call disabled">Tel Yok</span>):(<span style={{color:'#00c853',fontWeight:600,fontSize:'0.9rem'}}>✓ Geldi</span>)}
              </div>
            ))
          )}
        </div>
      </div>

      {showResetConfirm&&(
        <div className="modal" onClick={()=>setShowResetConfirm(false)}>
          <div onClick={e=>e.stopPropagation()}>
            <div style={{fontSize:'2.5rem',marginBottom:'12px'}}>⚠️</div>
            <h3 style={{color:'#fff',margin:'0 0 10px'}}>Emin misiniz?</h3>
            <p style={{color:'rgba(255,255,255,0.6)',margin:'0 0 20px'}}>TÜM işaretler sıfırlanacak!</p>
            <div style={{display:'flex',gap:'10px',justifyContent:'center'}}>
              <button className="fbtn" onClick={()=>setShowResetConfirm(false)}>İptal</button>
              <button className="btn" onClick={()=>{resetAll();setShowResetConfirm(false)}}>Sıfırla</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
